import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div className="text-center">
      <h1 className="text-4xl font-bold mb-4">Welcome to CrossFi Payment Request App</h1>
      <p className="mb-8">Easily create and manage payment requests using XFI tokens.</p>
      <div className="space-x-4">
        <Link to="/create" className="bg-blue-500 text-white px-6 py-3 rounded-lg hover:bg-blue-600">Create Request</Link>
        <Link to="/dashboard" className="bg-green-500 text-white px-6 py-3 rounded-lg hover:bg-green-600">View Dashboard</Link>
      </div>
    </div>
  );
};

export default Home;
